import React from 'react';

const AssignEquipment = () => {
    return (
        <div className="assign-equipment-page">

            
            <section className="header-section">
                <h1>Assign Equipment</h1>
                <p>Assign Equipment to Employees</p>
            </section>
            
            <section className="contact-form-section">
                <form>
                    <select>
                        <option>Select Employee</option>
                        {/* Employee options would be populated here */}
                    </select>
                    <select>
                        <option>Select Equipment</option>
                        {/* Equipment options would be populated here */}
                    </select>
                    <button type="submit">Assign Equipment</button>
                </form>
            </section>
            
            <section className="faq-section">
                <h2>FAQ</h2>
                {/* FAQ items would go here */}
            </section>
            
            <section className="cta-section">
                <p>Manage equipment assignments more efficiently!</p>
            </section>
            

        </div>
    );
};

export default AssignEquipment;
